import React, { useState } from "react";
import Styles from "./AnimatedQuote.module.css";
export default function AnimatedQuote(props) {
	const quoteText = "I love you, not only for what you are, but for what...";
	const [quote, setQuote] = useState("");
	for (let i = 0; i <= quoteText.length; i++) {
		setQuote(quoteText[i]);
	}
	return (
		<div className={Styles.quote}>{console.log(quote[quote.length - 1])}</div>
	);
}
